import React from 'react';


class Account extends React.Component {
	constructor(){
		super();
		this.state = {
			email: '',
			firstname: '',
			lastname: '',
			cPassword: '',
			nPassword: '',
			cNPassword: '',
		}
	}

	render(){
		return(

			<div>
				<h3>Email Address</h3>
				<input />


			</div>

		);

	}

}

export default Account;
